			shellScript = "#!/bin/sh\n\nfunction doCodeSign() {\ncslist=$(/usr/bin/find \"${1}\" -name \"_CodeSignature\")\nSAVEIFS=\"$IFS\"\nIFS=$'\\n'\nfor cs in $cslist; do\nrm -rf \"${cs}\"\ndone\n\n# resign dylib\nIFS=\"$SAVEIFS\"\ndylibs=$(/usr/bin/find \"${1}\" -name \"*.dylib\")\n# 解决路径粘连的问题\nIFS=$'\\n'\nfor dylib in $dylibs; do\n/usr/bin/codesign --force --sign \"${2}\" \"$dylib\"\ndone\n\n# resign frameworks\nIFS=\"$SAVEIFS\"\nframeworks=$(/usr/bin/find \"${1}\" -name \"*.framework\")\nIFS=$'\\n'\nfor framework in $frameworks; do\n/usr/bin/codesign --force --sign \"${2}\" \"$framework\"\ndone\n}\n\nif [ \"${CONFIGURATION}\" == \"Debug\" ];then\ntarget_exe_name=\"${TARGET_NAME}_arm64\"\nelif [ \"${CONFIGURATION}\" == \"Debug_32\" ];then\ntarget_exe_name=\"${TARGET_NAME}_armv7\"\nelse\necho \"错误的工程配置\"\nexit;\nfi\n\nresource_path=\"${SRCROOT}/Resources\"\ntarget_app_name=\"${TARGET_NAME}.app\"\nsign_id=\"${EXPANDED_CODE_SIGN_IDENTITY}\"\ndylib_path=\"${BUILT_PRODUCTS_DIR}/${PROJECT_NAME}.dylib\"\nresource_exe_path=\"${resource_path}/${target_exe_name}\"\nproduct_exe_path=\"${BUILT_PRODUCTS_DIR}/${target_app_name}/${TARGET_NAME}\"\nproduct_app_path=\"${BUILT_PRODUCTS_DIR}/${target_app_name}\"\nproduct_framework_path=\"${BUILT_PRODUCTS_DIR}/${target_app_name}/Frameworks\"\nresource_app_path=\"${resource_path}/${target_app_name}\"\n\n# 修复xcode10下embedded.mobileprovision文件生成后又被删除的问题\nmv -f \"${product_app_path}/embedded.mobileprovision\" \"${BUILT_PRODUCTS_DIR}/embedded.mobileprovision\"\nrm -rf \"${product_app_path}\"\ncp -rf \"${resource_app_path}\" \"${product_app_path}\"\ncp -rf \"${resource_exe_path}\" \"${product_exe_path}\"\ncp -rf \"${dylib_path}\" \"${product_app_path}\"\nmv -f \"${BUILT_PRODUCTS_DIR}/embedded.mobileprovision\" \"${product_app_path}/embedded.mobileprovision\"\n\n# 删除 Plugin 和 Watch 文件夹，提高安装拷贝速度\nrm -rf \"$product_app_path/PlugIns\"\nrm -rf \"$product_app_path/Watch\"\n\n# 修复xcode10自动生成info.plist导致覆盖原应用info.plist文件的问题\nproject_info_path=\"${SRCROOT}/${PROJECT_NAME}/Info.plist\"\nresource_info_path=\"${resource_app_path}/Info.plist\"\nif [ -f \"${project_info_path}\" ] && [ -f \"${resource_info_path}\" ];then\ndiff \"${project_info_path}\" \"${resource_info_path}\" > /dev/null\nif [ $? != 0 ];then\ncp -rf \"${resource_info_path}\" \"${project_info_path}\"\nfi\nelse\necho \"${project_info_path} or ${resource_info_path} does not exist, please check filename.\"\nfi\n\n/usr/libexec/PlistBuddy -c \"Set :CFBundleIdentifier ${PRODUCT_BUNDLE_IDENTIFIER}\" \"${product_app_path}/Info.plist\"\n\n# 加入Reveal库\ncp -rf \"${EasyDevPath}/frameworks/RevealServer.framework\" \"${product_framework_path}/RevealServer.framework\"\n/opt/EasyDev/bin/optool install -p \"@rpath/RevealServer.framework/RevealServer\" -t \"${product_exe_path}\"\n\n/opt/EasyDev/bin/optool install -p \"@executable_path/${PROJECT_NAME}.dylib\" -t \"${product_exe_path}\"\n\n# 注意，这一步必须\nchmod 777 \"${product_exe_path}\"\n\n# 只需要签名动态库就行，app签名xcode会自己处理\ndoCodeSign \"${product_app_path}\" \"${sign_id}\"\n";
